import SetencaBox2 from './componentes/SetencaBox2/SetencaBox2';

class PageSelect extends React.Component{
  constructor(props){
    super();
    this.state = {
        inNew : true,
        setenceBox : true,
    }
  }

  render(){
    let setence ;
    if(setenceBox){
      setence = <SetencaBox/>
    }
    else{
      setence = <SetencaBox2/>
    }
    return(
      <div>
         <Topbuttons inNew = {this.state.inNew} setenceBox = {this.state.setenceBox}/>
          <div className = "space_setence">
            {setence}
          </div>
          <div className = "space_setence">
            {this.props.setenceBox}
          </div>
          <div className = "space_setence">
            {this.props.setenceBox}
          </div>
      </div>
    )
  }
}

function App() {
  return (
     <div className="home">
      <header className="navbar_toolbar">
        <Toolbar /> 
      </header>
        <div className= "topbuttonDiv">
          <PageSelect/>
        </div>
    </div>
  );
}

export default App;
